    var parser =3D new DOMParser();=0A=
    var xmlDocument =3D =
parser.parseFromString($(this).text(),"text/xml");=0A=
    xmlPP.print(xmlDocument, $(this)[0]);=0A=
    });=0A=
};=0A=
=0A=
function formatJSON() {=0A=
  $('.u-Report td').each(function(){=0A=
    cell$ =3D $(this);=0A=
