function table2CSV($table){
    var output =3D '';

    var escapeCSV =3D function( txt ){

        if ( txt.indexOf( '"' ) > -1 ) {
            txt =3D txt.replace( /"/g,  '""' );
        }=20

        if ( txt.indexOf( ',' ) > -1 ) {
            txt =3D '"' + txt + '"';
        }

        return txt;
    };

    $table.find('tr').each(function(i, e){
        var s =3D (i =3D=3D 0) ? 'th' : 'td';

        var placeholder =3D [];
        $(this).find( s ).each(function(ci, ce){
            var val =3D escapeCSV( $(this).html() );
            placeholder.push( val );
        });

        output +=3D placeholder.join(',');
        output +=3D '\n';
    });

    return output;
}

function download(filename, text) {
  var element =3D document.createElement('a');
  element.setAttribute('href', 'data:text/plain;charset=3Dutf-8,' + =
encodeURIComponent(text));
  element.setAttribute('download', filename);

  element.style.display =3D 'none';
  document.body.appendChild(element);

  element.click();

  document.body.removeChild(element);
}

function generateAndDownloadCSV($table){
    var csv =3D table2CSV( $table );
    var filename =3D 'table.csv';

    download( filename, csv );
}

function listenLinks(){
    $('.download-table2CSV').on('click', function(){
        console.log($(this).prev());

        // Look above table sibling
        var $table =3D $(this).prev();

        // Generate & download CSV
        generateAndDownloadCSV( $table );
    });
}

function createLink(){
    var linkLabel =3D 'Download CSV';
    var $link =3D $('<a>');

    $link.attr( 'href', '#' );
    $link.addClass( 'download-table2CSV' )
    $link.html( linkLabel );

    return $link[0];
}

function createCSVDownloadLink(selector){
    var $tables =3D $(selector);

    // Find all tables
    $tables.each(function(i, e){
        // Add link after it with action generate & download CSV
        $link =3D createLink();

        $(this).after( $link );
    });

    // Listen click event on links
    listenLinks();
}
